function isValidBichord(v1, v2) {
    if (v1 === 'C5') {
        return v2 == 'E5' || v2 == 'G5'
    } else if (v1 === 'D5') {
        return v2 == 'G5' || v2 == 'Bb5'
    } else if (v1 === 'E5') {
        return v2 == 'Bb5'
    }
}

